import ReactDOM from 'react-dom'
import React from 'react'
import './index.css'
import Hamburger from './hamburger-menu.svg'


function Navbar() {
    return (
        <header class="navbar-box navbar-position navbar-text">
            <div id="header-text">
                <button>dsd</button>
                <span>Museum</span>
            </div>
        </header>
    )
}

function Test() {
    return (
        <div class="box">
            a Test
            <button>cool button</button>
        </div>
    )
}

function Manytests() {
    return (
        [
            <Navbar />
        ]
    )
}

ReactDOM.render(
    <Manytests />,
    document.getElementById('root')
);
